    img2D[ptB[0] + ptB[1] * dims2D[0]] = pen;
    let xs = -1;
    let ys = -1;
    if (ptB[0] > ptA[0])
      xs = 1;
    if (ptB[1] > ptA[1])
      ys = 1;
